    data: |
      SELECT + col2 * col1 + + - col1 * col2 AS col0, + 93 AS col1 FROM tab0 (FORMAT parquet) WHERE NULL IS NULL;
  - name: tab0

outputs:
  - name: q10759.out
    data: |
      0	93
      0	93
      0	93
